window.bookSummaryJSON = "<p>They say to keep your friends close but your enemies closer.</p> <p>What if they’re one and the same?</p> <p>The stable foundation I thought I’d built in the Sanctuary has been ripped away, and I find myself on the front lines of the war against the Resistance. I might have my Bonds on my side, but there are darker schemes in motion.</p> <p>Can I prove myself and turn the tide to protect our most vulnerable, or am I nothing more than the monster they’ve always claimed I am?</p> <p>Will we make it out of this without tragic consequences?</p>"; 
